import React from "react";
import Task from "./task";

export default class SearchResult extends React.Component {

  tasks = () => {
    const filtiredTasks =this.props.filtiredTasks;
    if (filtiredTasks)
      return filtiredTasks.map(
        task => <Task key={task._id} task={task} {...this.props}/>
      );
  };
  
  render() {
    const loadingfiltiredTasks = this.props.loadingfiltiredTasks;
    return (
      <div>
        <div className="row justify-content-md-center">
          <div className="card text-white bg-dark col-md-9 mb-3">
            <div className="card-header">
              <h1>Search Result</h1>
              {loadingfiltiredTasks && (
                <img
                  src="data:image/gif;base64,"
                  alt="wait loging"
                />
              )}
            </div>
            <div className="card-body">
              {this.tasks()}
            </div>
          </div>
        </div>
      </div>
    );
  }
}

